    public void updatePlanInfo(PlanModal plan) {

        SQLiteDatabase db = this.getWritableDatabase();
        ContentValues values = new ContentValues();

        values.put(IS_COMPLETED, plan.getIsCompleted());
        values.put(WHICH_STEP, plan.getWhichStep());
        values.put(STATUS_REGISTRATION, plan.getStatusRegistration());
        values.put(PLAN_ADDRESS_UPDATED, plan.getAddressUpdated());
        values.put(PLAN_USER_DESCRIPTION, plan.getUserDescription());
        values.put(PLAN_PINNED_POSITION, plan.getPlanPinnedPosition());
        values.put(PLAN_PINNED, plan.getPlanPinned());
        db.update(PLANS_TABLE, values, PLAN_ID + " = ?", new String[]{String.valueOf(plan.getPlanID())});

//        db.execSQL("SELECT * FROM " + PLANS_TABLE + " ORDER BY " + PLAN_PINNED_POSITION , null);

        db.close();
    }

